import React from 'react';
import classes from './Cover.module.css';

const Cover = ({ isContentVisible, handleUncoverClick }) => {
  return (
    <div className={classes.uncover}>
      {!isContentVisible ? (
        <button className={classes.uncoverButton} onClick={handleUncoverClick}>
          Uncover
        </button>
      ) : (
        <div className={classes.content}>
          <p>
            Welcome to the enchanted world of dreams. Here, you can explore the depths of your
            subconscious mind and record your most captivating dreams.
          </p>
          <p>
            Begin your journey by clicking the "Get Started" button below to unlock the secrets of
            your imagination.
          </p>
        </div>
      )}
    </div>
  );
};

export default Cover;
